package com.cmw.main;

public class Result2 {
	
	private int price;
	private int money;
	private int moreM;
	private String say;
	
	public Result2() {
		// TODO Auto-generated constructor stub
	}

	public Result2(int price, int money, int moreM, String say) {
		super();
		this.price = price;
		this.money = money;
		this.moreM = moreM;
		this.say = say;
	}

	public int getPrice() {
		return price;
	}

	public void setPrice(int price) {
		this.price = price;
	}

	public int getMoney() {
		return money;
	}

	public void setMoney(int money) {
		this.money = money;
	}

	public int getMoreM() {
		return moreM;
	}

	public void setMoreM(int moreM) {
		this.moreM = moreM;
	}

	public String getSay() {
		return say;
	}

	public void setSay(String say) {
		this.say = say;
	}
	
	
	
	
}
